import '../assets/css/layout.css';
import Editor1 from '../components/editor/editor1';
import EditorZn from '../components/editor/editorZn.js';
import DropEn from './DropEn';
import DropZn from './DropZn';
import CkEditerEn from './CkEditerEn';
import CkEditerZn from './CkEditerZn';
const AddBenner = () => {
  return (
    <>
      <div className="container">
        <div class="row">
          <div className="col-sm-12">
            <div>
              <DropEn />
            </div>
          </div>
          <div className="col-sm-12">
            <div>
              <DropZn />
            </div>
          </div>
          <div className="col-sm-12">
            <div>
              <CkEditerEn />
            </div>
          </div>
          <div className="col-sm-12">
            <div>
              <CkEditerZn />
            </div>
            <div></div>
          </div>
        </div>
        <button className="btn btn-square btn-warning btn-sm" type="button">
          삭제
        </button>
        &nbsp; &nbsp;
        {/* <button className="edit-button">수정</button>{' '} */}
        <button
          className="btn btn-square btn-secondary active btn-sm"
          type="button"
        >
          수정
        </button>
      </div>
    </>
  );
};

export default AddBenner;
